import React from 'react';

const generateBlocks = ({modules}) => {
    if (modules) {
        return (
            <div>
                {modules.map((item) => {
                    return (
                        <div key={item.id} className="card">
                            <img src="" alt=""/>
                            <div className="card-body">
                                <p className="card-text"></p>
                            </div>
                        </div>
                    )
                })}
            </div>
        )
    }   
}

const Module = (props) => {
    console.log(props);
    return (
        <div>
            {generateBlocks(props)}
        </div>
    )
}

export default Module;
